import React from "react";
import 'bootstrap/dist/css/bootstrap.css';
import './signUp.css';

function SignUp() {
  return (
    <div className="">
      <div className="mb-3">
        <label htmlFor="inputUserName" className="form-label">User Name</label>
        <input type="text" className="form-control" id="inputUserName" name="userName" />
      </div>

      <div className="mb-3">
        <label htmlFor="inputPassword" className="form-label">Password</label>
        <input type="text" className="form-control" id="inputPassword" name="password" />
      </div>

      <div className="mb-3">
        <label htmlFor="inputConfirmPassword" className="form-label">Confirm Password</label>
        <input type="text" className="form-control" id="inputConfirmPassword" name="confirmPassword" />
      </div>
    </div>
  );
}

export default SignUp;
